import { React, createContext } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/App/App';
import {kahoot} from "../src/const/fakeDatabase"

const Context = createContext(kahoot[0]);

ReactDOM.render(
  <Context.Provider value={kahoot[0]}>
    <App />
  </Context.Provider>,
  document.getElementById('root')
);
